import React, { Component } from "react";
import { StyleSheet, View, Text, ScrollView } from "react-native";

function WinnerView(props) {
  return (
    <ScrollView style={[styles.container, props.style]}>
      <View style={styles.rect}>
        <View style={styles.firstRowRow}>
          <Text style={styles.firstRow}>First Row:</Text>
        </View>
      </View>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#E6E6E6",
    borderRadius: 7,
    marginBottom: 20,
  },
  rect: {
    width: 300,
    height: 75,
    backgroundColor: "rgba(245,245,245,1)",
    borderRadius: 7,
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 0,
    },
    elevation: 2,
    shadowOpacity: 0.25,
    shadowRadius: 5,
    flexDirection: "row",
    marginTop: 15,
    marginLeft: 13,
    marginBottom: 15,
  },
  firstRow: {
    fontFamily: "roboto-regular",
    color: "#121212",
    fontSize: 15,
  },
  yajat: {
    fontFamily: "roboto-regular",
    color: "#121212",
    marginLeft: 8,
    marginTop: 1,
  },
  firstRowRow: {
    height: 18,
    flexDirection: "row",
    flex: 1,
    justifyContent: "flex-start",
    alignContent: "flex-start",
    marginRight: 172,
    marginLeft: 18,
    marginTop: 31,
  },
});

export default WinnerView;
